import React from "react";
import {
  TeamContainer,
  Member,
  Photo,
  Name,
  Position,
  Link,
} from "./about_style.js";
import ericPhoto from "../imgs/Eric.jpg";

const members = [
  {
    name: "Eric O'Neil",
    photo: ericPhoto,
    linkedin: "https://www.linkedin.com/in/john-doe/",
  },
  {
    name: "Brian Schmid",
    photo: "https://example.com/jane-smith.jpg",
    linkedin: "https://www.linkedin.com/in/eric-oneil1/",
  },
  // Add more members here...
];

function About() {
  return (
    <TeamContainer>
      {members.map((member) => (
        <Member key={member.name}>
          <Photo src={member.photo} alt={member.name} />
          <Name>{member.name}</Name>
          <Position>{member.position}</Position>
          <Link href={member.linkedin}>LinkedIn Profile</Link>
        </Member>
      ))}
    </TeamContainer>
  );
}

export default About;
